import React from 'react';

class About extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="w-100 p-5 vh-90 border-top border-bottom border-5 border-primary" >

        <div>
           <h2>Design Implentation</h2>
           <p>I implement web designs with the precision and the right tools within agreed time</p>
        </div>
        <div>
           <h2>Collaboration</h2>
           <p>I collaborate with other developers to build products that are of high quality.</p>
        </div>
        <div>
           <h2>Values</h2>
           <p>I have got great teamwork and efficiency, quality, and appreciation as my set of values</p>
        </div>
      </div>
    );
  }
}

export {About}
